import React from 'react'
import { Container } from 'react-bootstrap'
import HeaderMainWrapper from './HeaderMainWrapper'

function HeaderMain() {
    return (
        <div class="header-main">
            <Container>
                <HeaderMainWrapper />
            </Container>

            
        </div>
    )
}

export default HeaderMain
